import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";

import { _getFavsList } from "./../../util/req";
export default function Index() {
  const [List, setList] = useState([]);
  const [sort, setSort] = useState(false);

  const getList = async () => {
    var data = await _getFavsList(JSON.parse(localStorage.getItem("user"))._id);
    var mpdata = data.data.map((it, index) => ({
      ...it,
      ...it.place[0],
    }));
    setList(mpdata);
    console.log("data -> :", mpdata);
  };
  useEffect(() => {
    getList();
  }, []);

  return (
    <div style={{ overflowX: "auto" }} className="info-center">
      <br />
      <br />
      <br />
      <table>
        <thead>
          <tr>
            <th style={{ width: "24%" }}>
              HOSPNAME{" "}
              {sort ? (
                <span
                  onClick={() => {
                    setSort(false);
                  }}
                >
                  ↑
                </span>
              ) : (
                <span
                  onClick={() => {
                    setSort(true);
                  }}
                >
                  ↓
                </span>
              )}
            </th>
            <th>NAME</th>
            <th>FORMATTED_ADDRESS</th>
            <th>WEBSITE</th>
            <th>TOPWAIT</th>
            <th>RATING</th>
            <th>ICON</th>
          </tr>
        </thead>
        <tbody>
          {List.map((it, index) => (
            <tr key={index}>
              <td>
                <Link to={`/index/info/${it.place_id}`}>
                  {it.wait && it.wait.hospName}
                </Link>
              </td>
              <td>{it.name}</td>
              <td>{it.formatted_address}</td>
              <td>
                <a href={it.website}>{it.website}</a>
              </td>
              <td>{it.wait && it.wait.topWait}</td>
              <td>{it.rating}</td>
              <td><img src={it.icon} width="50px" height="50px" alt="" /></td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
